import React from 'react'
import { API } from "../../backend"
const ImageHelper = ({product}) => {
var imgUrl = product ? `${API}/product/photo/${product._id}` : 
"https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Ftse3.mm.bing.net%2Fth%3Fid%3DOIP.MCFZyDSl-2j8ZI7dpVsNHwHaEi%26pid%3DApi&f=1"

    return (
        <div className="rounded border border-success p-2">
                <img
                  src={imgUrl}
                  alt="photo"
                  style={{ maxHeight: "100%", maxWidth: "100%" }}
                  className="mb-3 rounded"
                />
              </div>
    );
}
export default ImageHelper;
